import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';
import LinkWrapper from './LinkWrapper';
import {
  BrowserRouter,
  Route,
} from "react-router-dom";
import About from './component/about';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <LinkWrapper/>
        <Route path="/about">
          <About/>
        </Route>
      </BrowserRouter>
    </div>
  );
}

export default App;
